--
-- Stappen voor het inladen
-- 1. Voer een truncate cascade uit op de levsautorisatie tabel
-- 2. Start een terminal en navigeer naar brp-code/test/deployment-art-omgeving/resources/
-- 3. Voer commando uit: psql -d art-brp -U postgres -h localhost -f autaut_analyse.sql
--    Dit commando laad de data in het autaut schema
--
-- Om de expressies voor populatie beperking te bekijken:
-- select * from autaut.dienstbundel where naderepopulatiebeperking is not null and naderepopulatiebeperking <> 'WAAR'

-- Om de expressie voor attenderingscriterium te bekijken:
-- select * from autaut.dienst where attenderingscriterium is not null

SET statement_timeout = 0;
SET lock_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;

SET search_path = autaut, pg_catalog;

SET default_tablespace = '';

SET default_with_oids = false;





